import React from 'react'
import Home from './Home'
import Table from 'react-bootstrap/Table';
import Container from 'react-bootstrap/Container';
import TicketDetails from './TicketDetails'

class TicketList extends React.Component{
	constructor(props) {
    	super(props);
    	this.state = {
    		show: false,
    		data: []
    	};

    };

    componentDidMount() {
      const url = "/pages/index";
      fetch(url)
        .then(response => {
          if (response.ok) {
            return response.json();
          }
          throw new Error("Network response was not ok.");
        })
        .then(response => this.setState({ data: response }))
        .catch(() => this.props.history.push("/"));

  		// console.log(this.state);

  	};

	render () {
		return	(
			<>
				<Container>
				<div>
				{this.state.data}
				</div>
				<Table bordered hover>
				  <thead>
				    <tr>
				      <th>ID</th>
				      <th>Subject</th>
				      <th>Status</th>
				      <th>Priority</th>
				      <th>Tags</th>
				      <th>Created</th>
				      <th>Updated</th>
				    </tr>
				  </thead>
				  <tbody>
				    <tr>
				      <td>1</td>
				      <td>Mark</td>
				      <td>Otto</td>
				      <td>@mdo</td>
				      <td>1</td>
				      <td>Mark</td>
				      <td>Otto</td>
				    </tr>
				    <tr>
				      <td>2</td>
				      <td>Jacob</td>
				      <td>Thornton</td>
				      <td>@fat</td>
				      <td>2</td>
				      <td>Jacob</td>
				      <td>Thornton</td>
				    </tr>
				    <tr>
				      <td>2</td>
				      <td>Jacob</td>
				      <td>Thornton</td>
				      <td>@fat</td>
				      <td>2</td>
				      <td>Jacob</td>
				      <td>Thornton</td>
				    </tr>
				  </tbody>
				</Table>
				</Container>

				{this.state.show && <TicketDetails>{this.state.show} </TicketDetails>}

			</>
		)

	}
}

export default TicketList
